import React from 'react';
import {PriceCardDisplayV} from './src/PriceCardWidget';

const ServicesData=[ {name:"Access to basic tutorials",id:1},
{name:"Basic resources",id:2},
{name:"Basic community access",id:3},
{name:"eBooks",id:4},
{name:"Podcats",id:5},
{name:"Access to souces files",id:6},
{name:"Live chat",id:7},];


const cardData=[
{
  planName:"free",
  amount:"$28 /month",
  bg:'#FFCCBC'
},
{
  planName:"Standard",
  amount:"$35 /month",
  bg:'#BCEFD6'
},
{
  planName:"Premium",
  amount:"$42 /month",
  bg:'#BBEBFA'
}
];



const PlanNameStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  paddingTop:'10px',
  textTransform:'uppercase'
  // marginTop:'5px',
}

const amountStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'35px',
  marginTop:'25px',
  marginBottom:'20px'
}

const listStyles={
  fontSize:"20px",
  color:'white',
  listStyleType:'none',
  textAlign:'left',

}

const buttonStyles={

  fontWeight:'300',
  fontSize:'20px',
  marginTop:'10px',
}


function App() {
  return (
    <div>
     <PriceCardDisplayV
     cardData={cardData}
     ServicesData={ServicesData}
     PlanNameStylesStyles={PlanNameStyles}
     amountStyles={amountStyles}
     listStyles={listStyles}
     buttonStyles={buttonStyles}
     />
    </div>
  );
}

export default App;
